import  { Col, Container, Row } from 'react-bootstrap';
import './css/style.css';
import { datauser } from './data';
import DataCount from "./componenets/datacount"
import Listuser from './componenets/listUser';

const App = () => {

      return (
            <div>
                  <div className='container'>
                     <DataCount count={datauser.length}></DataCount>
                        <Listuser count={datauser.length} ></Listuser>

                        <div className='boxbtn'>
                              <Col ms="8" className='flex'>
                              <button>مسح الكل</button>
                              <button>عرض البيانات</button>
                              </Col>
                        </div>
                  </div>
            </div>
      )
}


export default App
